import recipeView from "./view/recipeView";
import searchView from "./view/searchView.js";
import resultView from "./view/resultView.js";
import paginationView from "./view/paginationView.js";
import bookmarkView from "./view/bookmarkView.js";
import addRecipeView from "./view/addRecipeView.js";
import * as modal from "./model.js";
const controlRecipe = async function () {
  try {
    const id = window.location.hash.slice(1);
    recipeView.rednerSpinner();
    await modal.loadRecipe(id);
    recipeView.render(modal.state.recipe);
  } catch (err) {
    console.log(err);
  }
};

const controlSearch = async function () {
  try {
    const query = searchView.getQuery();
    resultView.rednerSpinner();
    if (!query) return;
    await modal.searchRecipe(query);
    resultView.render(modal.searchPagination());
    paginationView.render(modal.state.search);
    bookmarkView.update(modal.state.bookmarks);
    addRecipeView.update()
    console.log(modal.state.search.resutls);
  } catch (err) {
    console.log(err);
  }
};
const controlPagination = function (update) {
  resultView.render(modal.searchPagination(update));
  paginationView.render(modal.state.search);
};

const controlServings = function (updateTo) {
  modal.updateServings(updateTo);
  recipeView.update(modal.state.recipe);
};
const controlBookmark = function () {
  if (!modal.state.recipe.bookmarked)
    modal.addBookmarkRecipe(modal.state.recipe);
  else modal.removeBookmarkRecipe(modal.state.recipe.id);
  console.log(modal.state.bookmarks);
  recipeView.update(modal.state.recipe);
  bookmarkView.render(modal.state.bookmarks);
  if (modal.state.bookmarks.length === 0) bookmarkView.renderMessage();
};
const controlAddBookmark = function () {
  bookmarkView.render(modal.state.bookmarks);
  if (modal.state.bookmarks.length === 0) bookmarkView.renderMessage();
};
const controlAddRecipe = function (newRecipe) {
  try {
    console.log(newRecipe);
    modal.addRecipeNew(newRecipe);
  } catch (err) {
    console.log(err);
  }
};
const init = function () {
  recipeView.handlerLoadRecipe(controlRecipe);
  recipeView.handlerServings(controlServings);
  recipeView.handlerBookmark(controlBookmark);
  addRecipeView.handlerForm(controlAddRecipe);
  searchView.handlreSearch(controlSearch);
  bookmarkView.handlerBookmark(controlAddBookmark);
  paginationView.handlrePagination(controlPagination);
};

init();
